import { Button } from '@mui/material'
import { Routes, Route, Navigate} from 'react-router-dom'

export const AppRoutes = () => {
  return (
    <Routes>
      <Route path="/" element={<Button variant='contained'>Test</Button>} />
      <Route path="*" element={<Navigate to="/pagina-ionical"/>} />
    </Routes>
  )
}
